def find_solution(a, b, n):
    def extended_gcd(a, b):
        if a == 0:
            return (b, 0, 1)
        else:
            g, x, y = extended_gcd(b % a, a)
            return (g, y - (b // a) * x, x)

    g, x, y = extended_gcd(a, b)
    if n % g != 0:
        return None
    x *= n // g
    y *= n // g
    return (x, y)

