def is_majority(arr, n, x):
    def find_first_index(arr, low, high, x):
        if high >= low:
            mid = (low + high) // 2
            if (mid == 0 or x > arr[mid - 1]) and arr[mid] == x:
                return mid
            elif x > arr[mid]:
                return find_first_index(arr, mid + 1, high, x)
            else:
                return find_first_index(arr, low, mid - 1, x)
        return -1

    def find_last_index(arr, low, high, x):
        if high >= low:
            mid = (low + high) // 2
            if (mid == n - 1 or x < arr[mid + 1]) and arr[mid] == x:
                return mid
            elif x < arr[mid]:
                return find_last_index(arr, low, mid - 1, x)
            else:
                return find_last_index(arr, mid + 1, high, x)
        return -1

    first_index = find_first_index(arr, 0, n - 1, x)
    if first_index == -1:
        return False
    last_index = find_last_index(arr, first_index, n - 1, x)
    return (last_index - first_index + 1) > n // 2

