def max_sub_array_sum_repeated(arr, n, k):
    def kadane(arr, n):
        max_so_far = float('-inf')
        max_ending_here = 0
        for i in range(n):
            max_ending_here += arr[i]
            if max_so_far < max_ending_here:
                max_so_far = max_ending_here
            if max_ending_here < 0:
                max_ending_here = 0
        return max_so_far

    max_kadane = kadane(arr, n)
    if k == 1:
        return max_kadane

    total_sum = sum(arr)
    max_wrap = kadane(arr * 2, n * 2)

    if total_sum > 0:
        return max(max_kadane, max_wrap + (k - 2) * total_sum)
