def pancake_sort(arr):
    def flip(sublist, k):
        i = 0
        while i < k / 2:
            sublist[i], sublist[k - i - 1] = sublist[k - i - 1], sublist[i]
            i += 1

    n = len(arr)
    while n > 1:
        max_index = arr.index(max(arr[:n]))
        if max_index != n - 1:
            if max_index != 0:
                flip(arr, max_index + 1)
            flip(arr, n)
        n -= 1
    return arr

